import { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router";
import { dashboard } from "../../routes";
import apiEndpoints from "../../data/environment";
import { useAppSelector } from "../../app/hooks";
import { selectAuthUser } from "../../services/Auth/AuthSelectors";

function RentNowForm() {
    const navigate = useNavigate();
    const { carId, bookingId } = useParams<{ carId: string; bookingId?: string }>();
    const [startDate, setStartDate] = useState("");
    const [endDate, setEndDate] = useState("");
    const [summary, setSummary] = useState<any>(null);
    const user = useAppSelector(selectAuthUser);

    // Redirect if carId is missing
    if (!carId) {
        navigate(dashboard);
        return null;
    }

    // If editing, fetch existing booking
    useEffect(() => {
        const fetchBooking = async () => {
            if (!bookingId) return;

            try {
                const response = await fetch(`/api/bookings/${bookingId}`);
                const data = await response.json();

                if (response.ok) {
                    setStartDate(data.startDate);
                    setEndDate(data.endDate);
                    setSummary(data); // Optional: show summary
                } else {
                    alert(data.message || "Failed to load booking.");
                }
            } catch (error) {
                console.error("Error fetching booking:", error);
                alert("An error occurred while loading the booking.");
            }
        };

        fetchBooking();
    }, [bookingId]);

    const handleCheckAvailability = async () => {
        try {
            if (user === null) {
                alert("Please log in to check availability.");
                return;
            }
            const response = await fetch(apiEndpoints.bookingSummary, {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    car_id: parseInt(carId),
                    start_date: startDate,
                    end_date: endDate,
                    customer_id: user.customer_id
                })
            });

            const result = await response.json();

            if (response.ok) {
                setSummary(result);
            } else {
                console.error("Booking summary error:", result);
                alert(result.message || "Booking check failed.");
            }
        } catch (err) {
            console.error("Fetch error:", err);
            alert("An unexpected error occurred. Check console for details.");
        }
    };

    const handleConfirmBooking = async () => {
        const bookingPayload = {
            car_id: parseInt(carId),
            start_date: startDate,
            end_date: endDate,
            customer_id: user?.customer_id,
            confirm: true
        };

        const url = bookingId ? `/api/bookings/${bookingId}` : apiEndpoints.bookingConfirm;
        const method = bookingId ? "PUT" : "POST";

        try {
            const response = await fetch(url, {
                method,
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(bookingPayload)
            });

            if (response.ok) {
                alert(bookingId ? "Booking updated!" : "Booking confirmed!");
                navigate(dashboard);
            } else {
                const error = await response.json();
                alert(error.message || "Booking failed.");
            }
        } catch (err) {
            console.error("Error confirming booking:", err);
            alert("Unexpected error. Check console.");
        }
    };

    return (
        <div className="app-container">
            <h1>{bookingId ? "Edit Booking" : "Rent Now"} - Car ID: {carId}</h1>

            <label>
                Start Date:
                <input type="date" value={startDate} onChange={(e) => setStartDate(e.target.value)} />
            </label>

            <label>
                End Date:
                <input type="date" value={endDate} onChange={(e) => setEndDate(e.target.value)} />
            </label>

            <button onClick={handleCheckAvailability}>Check Availability & Price</button>

            {summary && (
                <div>
                    <h2>Summary</h2>
                    <p>Customer: {summary.customer_name}</p>
                    <p>Total Payment: ${summary.total_payment}</p>
                    <p>Insurance: ${summary.insurance_val}</p>
                    {summary.discount_price && <p>Discounted Daily Rate: ${summary.discount_price}</p>}
                    <button onClick={handleConfirmBooking}>
                        {bookingId ? "Update Booking" : "Confirm Booking"}
                    </button>
                </div>
            )}

            <button onClick={() => navigate(dashboard)}>Back to Dashboard</button>
        </div>
    );
}

export default RentNowForm;
